$(function(){
    var content = $('#plugins_iframe_themes').contents();
    if(content.length<=0){
        content = $('body');
    }
    if($(content).find('#header .default_account_style .SignInButton ').length){
        if($(content).find('#header .default_account_style .SignInButton').hasClass('FontColor')){
            $(content).find('#header .default_account_style').find('.not_dd').addClass('has_after');
        }
    }
});

$(window).ready(function(){
	// 产品评论
	var HtmlContent = '';
	HtmlContent += '<div class="list_item">';
		HtmlContent += '<div class="item">';
		HtmlContent += ' <div class="item_img">{review_img}</div>';
		HtmlContent += '  <div class="item_text">';
		HtmlContent += '   <div class="item_name">';
			HtmlContent += '<strong>{review_name}</strong>';
			HtmlContent += '<span>{review_time}</span>';
		HtmlContent += '   </div>';
		HtmlContent += '  <div class="item_star">{review_star}</div>';
		HtmlContent += '  <div class="item_content">{review_content}</div>';
		HtmlContent += '  <div class="reply_content">{reply_content}</div>';
		HtmlContent += '  <div class="review_pro_item">{review_pro_item}</div>'
		HtmlContent += ' </div>';
		HtmlContent += '</div>';
	HtmlContent += '</div>';
	setTimeout(function(){
		$('.default_products_review4[data-visual-id="3315"] .reviews_list_box').FlowReviewsTotalInit({HtmlContent:HtmlContent, ProId:$('#ProId').val(), Action:'goods', Rating: $('.default_products_review4[data-visual-id="3315"]').find('input[name=page]').attr('rating'), 'editMode' : $('.default_products_review4[data-visual-id="3315"]').find('input[name=editMode]').val()});
	},100);
})

